import "./App.css";

const Header = () => {
  return (
    <div className="header">
      <div className="Logo-Container">
        <img className="logo"
          src="https://i.pinimg.com/736x/34/0c/6a/340c6add7519212185a08d4205eb1965.jpg"
          alt="FoodDelivery"
        />
      </div>
      <div className="NavItems">
        <ul>
          <li>Home</li>
          <li>About Us</li>
          <li>Contac Us</li>
          <li>Cart</li>
        </ul>
      </div>
    </div>
  );
};

const AppLayout = () => {
  return (
    <div className="app">
      <Header />
    </div>
  );
};

export default AppLayout;
